            name: "Capitan America",
            description: "Marvel",
            mas: ""
        },
        {
            img: "../characters/kyloRen.jpg",
            name: "Kylo Ren",
            description: "Star Wars",
            mas: ""
        }
    ]

    return(
        <section class="card-container">
            <div>
            {
                cardData.map((card) => <Card img = {card.img} name = {card.name} description = {card.description} mas = {card.mas}/>)
            }
            </div>
        </section>
    )
}

export default CardGrid
